import logo from './logo.svg';
import './App.css';

function App() {
return (
<div className="App">
    <header className="App-header">
        <form className="form-inline">
            <div className="form-group mb-2">
                <label for="staticEmail2" className="sr-only">Email</label>
                <input type="text" readonly className="form-control-plaintext" id="staticEmail2"></input>
            </div>
            <div className="form-group mx-sm-3 mb-2">
                <label for="inputPassword2" className="sr-only">Password</label>
                <input type="password" className="form-control" id="inputPassword2" placeholder="Password"></input>
            </div>
            <button type="submit" className="btn btn-primary mb-2">Edit Event</button>
        </form>
    </header>
</div>
);
}

export default App;
